import React from "react";
import ReactDOM from "react-dom/client";
import Card from "./Card";
import './index.css';
import Sdata from "./Sdata";
import App from "./App";

function ncard(val) {
  return ( 
    <Card 
    key= {val.id}
    imgsrc={val.imgsrc}
    title={val.title}
    sname={val.sname}
    link={val.link}
  />
  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
   App()
);
